import { getPokemon } from "./PokeLi";
import React, { useState } from "react";
import Topo from "./Topo.jsx"

let PokemonWhatever = [];

function Status() {
  
    const [pokemonlist, setpokemonlist] = useState([]);

    const handlepokemon = (newPokemon) => {
    PokemonWhatever = [...PokemonWhatever, newPokemon];

    //console.log(PokemonWhatever);
    // PokemonWhatever.sort((a, b) => {
    //   return a.id - b.id;
    // });

    //console.log(PokemonWhatever);
    if (PokemonWhatever.length === 1) {
      setpokemonlist(PokemonWhatever);
    }
  };

  function fillPokemon() {
    Array(1)
      .fill()
      .map((_, index) => {
        const pokemon = getPokemon(3, handlepokemon);
        return pokemon;
      });
  }

  fillPokemon()

  const tentei = (pokemonlist.map((i) => {
      const elementTypes = i.types.map((typeInfo) => typeInfo.type.name);
      return i.name
  }))

  console.log(tentei)


   
  

  return (
    <div class="pokedex">
        <div class="left">
            <div class="left-main">
                <div class="left-top-wrapper">
                    <div class="left-top">
                        <div class="blueBtn btn huge"></div>
                        <div class="redBtn btn medium"></div>
                        <div class="jauneBtn btn medium"></div>
                        <div class="vertBtn btn medium"></div>
                    </div>

                </div>

                <div class="left-screen">
                    <div class="screen-border-grey">
                        <div class="screen-top-btn">
                            <div class="redBtn btn small"></div>
                            <div class="redBtn btn small"></div>
                        </div>
                        <div class="screen-black">
                            <img src="" alt="" id="image"></img>
                        </div>
                        <div class="screen-bottom-btn">
                            <div class="redBtn btn medium"></div>
                            <div class="burger">
                                <span></span>
                                <span></span>
                                <span></span>
                                <span></span>
                            </div>
                        </div>
                    </div>
                </div>

                <div class="left-commands">
                    <div class="noirBtn btn large"></div>
                    <div class="commands-central">
                        <div class="longBtn redBtn"></div>
                        <div class="longBtn blueBtn"></div>
                        <div class="greenScreen medlargeScreen"></div>
                    </div>
                    <div class="croix"></div>
                </div>
            </div>

            <div class="central-cylinder">
                <div class="cynlinder-central-block"></div>
            </div>
        </div>

        
        <div class="right-wrapper">
            <div class="right">
                <div class="blackScreen largeScreen"></div>
                <div class="gridBtn blueGrid">
                    <div class="gridCell"></div>
                    <div class="gridCell"></div>
                    <div class="gridCell"></div>
                    <div class="gridCell"></div>
                    <div class="gridCell"></div>
                    <div class="gridCell"></div>
                    <div class="gridCell"></div>
                    <div class="gridCell"></div>
                    <div class="gridCell"></div>
                    <div class="gridCell"></div>
                </div>
                <div class="longBtnRight">
                    <div class="longBtn noirBtn"></div>
                    <div class="longBtn noirBtn"></div>
                </div>
                <div class="gridBtn whiteGrid">
                    <div class="gridCell"></div>
                    <div class="gridCell"></div>
                </div>
                <div class="jauneBtn btn large"></div>
                <div class="noirScreen mediumScreen"></div>
                <div class="noirScreen mediumScreen"></div>
            </div>
        </div>

    </div>
  );
}

export default Status;
